// src/components/Navbar.js
import React from 'react';
import { slide as Menu } from 'react-burger-menu';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="logo-container">
                <img src="path/to/your/logo.png" alt="ViRix Logo" className="logo" />
                <h1>ViRix</h1>
            </div>
            <Menu right>
                <Link to="/map" className="menu-item">Map</Link>
                <Link to="/info" className="menu-item">Info</Link>
                <Link to="/about" className="menu-item">About Us</Link>
                <Link to="/tips" className="menu-item">Tips</Link>
            </Menu>
        </nav>
    );
};

export default Navbar;
